import React from "react";
import './search-box.style.css';


export const SearchBox = ({placeholder}) => {
    return (        
    
    <input type="search" className = "searchBox"    
    placeholder={placeholder} onChange = {e => this.setState({searchField: e.target.value})}/>
    );
};
